import React from "react";

const Contacts = ({ contacts, deleteContact }) => {
  return (
<div>
    <table >
  <tr>
    <th>Name</th>
    <th>Phone number</th>
  </tr>
  <tr>
    <td>Jill</td>
    <td>Smith</td>
    <td>50</td>
  </tr>
  <tr>
    <td>Eve</td>
    <td>Jackson</td>
    <td>94</td>
  </tr>
</table>
    <ul>
      {contacts.map((contact) => {
        return (
          <li key={contact.name}>
            {contact.name} {contact.number}
            <button onClick={() => deleteContact(contact.id)}>Delete</button>
          </li>
        );
      })}
    </ul>
    </div>
  );
};

export default Contacts;
